    ["2310"]=setmetatable({monsterId=2310,monsterShow=1,monsterOrder=2098,monsterShape=3,monsterIcon="monster_2310",monsterLock="击败解锁",monsterDanger="未知",monsterNo="AO-03-5",property="火",ability="极其特殊的唯一性个体，呈星型四面体结构，行为几乎无规律可言，存在明显的“思考”与“学习”迹象。与之遭遇过的斯露德小队提交的报告中称，和其他下位或衍生个体不同，星型四面体的结构中心处可观察到一枚与其属性相对应的“符文”，但无法被其随身携带的光学设备拍摄下来，造成这种现象的原因未知。",story1Name="描述",story1Text="极其特殊的唯一性个体，呈星型四面体结构，行为几乎无规律可言，存在明显的“思考”与“学习”迹象。与之遭遇过的斯露德小队提交的报告中称，和其他下位或衍生个体不同，星型四面体的结构中心处可观察到一枚与其属性相对应的“符文”，但无法被其随身携带的光学设备拍摄下来，造成这种现象的原因未知。",story1Lock=1,story2Name="描述",story2Text="“无论从哪个角度，都只能看到它的‘正面’？这份报告是谁提交的？通知她近期去进行一次精神状态…”“你刚才说什么？”“无论从哪个角度，都只能看到符文的‘正面’？”“‘正面’……报告呢？给我看看。”“可是…..您相信这种莫名其妙的报告吗？她们的报告中甚至还提到，每个人同一时间从不同位置看到的也都是符文的正面，还说符文无法用光学器材拍摄下来，这实在太荒谬了！世界上怎么可能存在从任何角度都只能观察到正面的东西？这不符合常识……”“正因为与[常识]相悖，才称的上[异常]，不是吗？”",story2Lock=10,monsterPosition={[1]=0,[2]=0.9,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=1.2},mt),
