    ["3010"]=setmetatable({monsterId=3010,monsterShow=1,monsterOrder=250,monsterShape=3,monsterIcon="monster_3010",monsterLock="击败解锁",monsterDanger="高危",monsterNo="CE-01",property="一般",ability="身体构成与大多数生物不同，类似某种水母纲生物，身体并非常见的固体，而是介于固体和流体之间的凝胶状，核心通常位于柔韧的伞帽状结构内（有少量核心不在伞状结构内的特例），伞状体边缘通常保留有触手结构，且触手一般具有很强的延伸与再生能力（实心或中空结构都有），借助伞状结构边缘部分的收缩动作产生动力，移动速度很慢且会有明显的环状源能轨迹。\n移动速度很慢，发起攻击时会将最柔韧的伞帽部分正对敌人。",story1Name="描述",story1Text="身体构成与大多数生物不同，类似某种水母纲生物，身体并非常见的固体，而是介于固体和流体之间的凝胶状，核心通常位于柔韧的伞帽状结构内（有少量核心不在伞状结构内的特例），伞状体边缘通常保留有触手结构，且触手一般具有很强的延伸与再生能力（实心或中空结构都有），借助伞状结构边缘部分的收缩动作产生动力，移动速度很慢且会有明显的环状源能轨迹。\n移动速度很慢，发起攻击时会将最柔韧的伞帽部分正对敌人。",story1Lock=1,story2Name="",story2Text="",story2Lock=0,monsterPosition={[1]=0,[2]=1,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.035},mt),
    ["3030"]=setmetatable({monsterId=3030,monsterShow=0,monsterOrder=0,monsterShape=3,monsterIcon="monster_3030",monsterLock="击败解锁",monsterDanger="高危",monsterNo="",property="一般",ability="大型源生种，通常在高空游荡，很少来到对它而言相当于“海底”的低空活动。",story1Name="描述",story1Text="大型源生种，通常在高空游荡，很少来到对它而言相当于“海底”的低空活动。",story1Lock=1,story2Name="",story2Text="",story2Lock=0,monsterPosition={[1]=0,[2]=0.9,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.038},mt),
    ["3031"]=setmetatable({monsterId=3031,monsterShow=1,monsterOrder=249,monsterShape=3,monsterIcon="monster_3031",monsterLock="击败解锁",monsterDanger="高危",monsterNo="CE-04",property="一般",ability="在高空徘徊了许久的大型异生体，它会利用口中所吐出的云雾隐藏自己的行踪，所以在很长一段时间中并没有被人们所目击。拥有可以在短时间中几乎绝对防御级别的外皮，但是代价则是只能持续一小段时间。",story1Name="描述",story1Text="虽然它的长处是隐藏和防御，但是在攻击的时候也是十分具有威胁性。",story1Lock=1,story2Name="描述",story2Text="“这段漫长的迷航，终于结束了。”",story2Lock=10,monsterPosition={[1]=0,[2]=0.9,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.038},mt),
    ["3040"]=setmetatable({monsterId=3040,monsterShow=1,monsterOrder=196,monsterShape=3,monsterIcon="monster_3040",monsterLock="击败解锁",monsterDanger="高危",monsterNo="D-09",property="一般",ability="大型源生种，通常栖息在阴暗环境中。",story1Name="描述",story1Text="大型源生种，通常栖息在阴暗环境中。",story1Lock=1,story2Name="",story2Text="",story2Lock=0,monsterPosition={[1]=0,[2]=0.88,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.0048},mt),
    ["3050"]=setmetatable({monsterId=3050,monsterShow=1,monsterOrder=2,monsterShape=3,monsterIcon="monster_3050",monsterLock="击败解锁",monsterDanger="高危",monsterNo="无",property="一般",ability="铵格尔仍在不断进化，她用巨人形态的茧包裹住自己，本体则在茧中休眠等待破茧成蝶。",story1Name="描述",story1Text="铵格尔仍在不断进化，她用巨人形态的茧包裹住自己，本体则在茧中休眠等待破茧成蝶。",story1Lock=1,story2Name="描述",story2Text="铵格尔在休眠时被神之子民们封印到了祭坛之中。一方面是为了抑制铵格尔的进化，另一方面则是为了祭坛中的石板不被贪婪的弱者偷走。\n在漫长的岁月中铵格尔理智已经逐渐溶解，只剩心中对进化和力量的无限信仰。",story2Lock=10,monsterPosition={[1]=0,[2]=0.4,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.0055},mt),
    ["3051"]=setmetatable({monsterId=3051,monsterShow=1,monsterOrder=1,monsterShape=3,monsterIcon="monster_3051",monsterLock="击败解锁",monsterDanger="高危",monsterNo="无",property="一般",ability="铵格尔仍在不断进化，她用巨人形态的茧包裹住自己，本体则在茧中休眠等待破茧成蝶。",story1Name="描述",story1Text="铵格尔仍在不断进化，她用巨人形态的茧包裹住自己，本体则在茧中休眠等待破茧成蝶。",story1Lock=1,story2Name="描述",story2Text="铵格尔在休眠时被神之子民们封印到了祭坛之中。一方面是为了抑制铵格尔的进化，另一方面则是为了祭坛中的石板不被贪婪的弱者偷走。\n在漫长的岁月中铵格尔理智已经逐渐溶解，只剩心中对进化和力量的无限信仰。",story2Lock=10,monsterPosition={[1]=0,[2]=1.12,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.22},mt),
    ["3062"]=setmetatable({monsterId=3062,monsterShow=1,monsterOrder=1024,monsterShape=3,monsterIcon="monster_3060",monsterLock="击败解锁",monsterDanger="高危",monsterNo="AE-22",property="一般",ability="被奥特拉玛琳召唤而来的巨型异生体。外观呈巨大的球体，透明度较低，只能隐约能看到被长矛贯穿的鲸鱼轮廓。在球体破碎后，它终于露出了属于自己原本的模样。",story1Name="描述",story1Text="外观呈巨大的球体，透明度较低，只能隐约能看到被长矛贯穿的鲸鱼轮廓。TEO-17每时每刻都在不断从外界抽取热量，导致所在环境的温度大幅降低。\n\n1.外侧的固态结构具有将接触到的物体瞬间冻结的特性，但这层结构即不是它的异空，也不是它自主生成的保护层，综合其不断从外界抽取热量的行为，以及未出现常见的外层混乱空间两点看来，更像是一道将其封锁在内的“枷锁”。\n\n更新：这一静止层恐怕都是由一记规模空前的【极奏】所导致的，这一【极奏】的效果并非简单的【低温】或者【冻结】，而是阻断一切变化的【静止】，这种【静止】甚至影响到了微观层面的粒子运动，但目前的记载中没有任何一位斯露德的【极奏】能达到这种程度，相关的检索结果皆显示为【数据删除】。\n更新2：整个球体的圆心与鲸鱼本身的重心点重合，同时这一点也在长矛的贯穿路径上，这一位置大概率为该异生体的核心所在。",story1Lock=1,story2Name="描述",story2Text="附录1：\n“也就是说，它的核心早已被击穿，而这一记几乎在物理意义上冻结了时间的【极奏】反而是在延续它的生命？”\n“从结果上来说，是这样。”\n“那它为什么还要不断尝试破解极奏的效果？”\n“谁知道呢......这种事恐怕只能问当事者自己了。”\n附录1：\n”那柄长矛的样子...总觉得在哪里见过。”——奈纳",story2Lock=10,monsterPosition={[1]=0,[2]=0.8,[3]=0},monsterRotation={[1]=0,[2]=0,[3]=0},monsterScale=0.009},mt),
    ["3070"]=setmetatable({monsterId=3070,monsterShow=1,monsterOrder=1023,monsterShape=0,monsterIcon="monster_3070",monsterLock="",monsterDanger="",monsterNo="无",property="一般",ability="因神经被毒液浸染而状若癫狂的斯露德。\n其理性意识被拖入深深的泥沼，被迫呼吸着决堤的悔恨、不堪、愤怒与绝望。\n她明明身处其中却又仿佛置身事外，清晰地看着那个极尽疯狂的自己攻击向本该被保护的同伴，那一刻，扎根在心底的不甘与挣扎陡然惊醒，她开始奋力挣扎。"},mt),
    ["3080"]=setmetatable({monsterId=3080,monsterShow=1,monsterOrder=1022,monsterShape=0,monsterIcon="",monsterLock="",monsterDanger="",monsterNo="无",property="一般",ability="出现于梦境之中，结合了麦当然的回忆产生的人型异生体，本质上只是梦境主人深层意识的投影……本该如此。\n然而在已记录的梦境中，它的某些行为与言语既非麦当然的回忆、亦不符合其深层意识的推演。\n推测，在梦境中那些无尽交杂的意识中，它可能衍生出了一定程度上的“自我意识”。"},mt),
    ["1"]=setmetatable({monsterId=1,monsterShow=0,monsterOrder=957,monsterShape=1,monsterIcon="",monsterLock="",monsterDanger="",monsterNo="",property="",ability="",story1Name="描述",story1Text="极其罕见的特殊异生体，有且仅有核心作为主体，核心呈黑色半透明规则几何体结构，表面有紫色纹路，通过半透明表面可以观察到核心内部与其属性相对应的符文，外围有与属性相应的光环，强度与核心的面数呈正相关，即正4、8、12、20面体、星光四面体（24面），分别对应威胁等级1-5，曾出现过违反欧拉定律，理论上不可能存在的正32面体结构，但该异生体仅短暂存在了【数据删除】就因结构崩溃而死亡。\n\n      值得一提的是，根据与AE-14遭遇过的斯露德提交的报告看来，无论斯露德与AE-14处于何种位置关系，看到的永远是这枚符文与光环的“正面”，甚至如果两位斯露德从不同角度观察，看到的也都是正面，造成这种现象的原因未知。\n",story1Lock=1,story2Name="攻击方式",story2Text="各种对应属性射线、弹幕、AOE\n",story2Lock=1},mt),
